import './Developer.css';

class Developer extends Component {
  render() {
    return (
      <div className="Developer">
        <header className="Dev-header">
          <p>i'm a developer...</p>
        </header>
        <div className="Dev-body">

        </div>
      </div>
    );
  }
}

export default Developer;
